import React from "react";
import "./App.css";

class App extends React.Component {
  state = {
    newLogoFacility: {},
    logoList: [
      {
        name: "aaa",
        imgBase64:
          "data:image/jpeg;base64,",
      },
      {
        name: "bbb",
        imgBase64:
          "data:image/jpeg;base64,",
      },
    ],
  };

  handleChangeUpdateLogo = (info) => {
    // if (info.file.status === "uploading") {
    //   this.setState({ loading: true });
    //   return;
    // }
    // if (info.file.status === "done") {
    //   this.setState({
    //     newLogoFacility: info.file.originFileObj,
    //     oldLogoFacility: "เอาข้อมูลของรูป เจฟเฟอร์มา set เข้าตรงนี้", // สำรองรูปไว้เผื่อ user กด cancle จะได้มีรูปเก่ามาใช้อีกรอบ
    //   });
    // }
    this.setState({
      newLogoFacility: info.target.files[0],
    });
    this.getBase64(info.target.files[0]);
  };

  getBase64(file) {
    var reader = new FileReader();
    reader.onloadend = function () {
      console.log("RESULT", reader.result);
    };
    reader.readAsDataURL(file);
  }

  handleSetNewLogoFacility = (base64) => () => {
    this.setState({ newLogoFacility: base64 });
  };

  renderLogoList() {
    return (
      this.state.logoList.length > 0 &&
      this.state.logoList.map((logo, index) => (
        <div>
          <img
            key={index}
            src={logo.imgBase64}
            style={{ width: 200, height: 200 }}
          />
          <button
            type="button"
            className="btn btn-primary"
            data-toggle="modal"
            data-target="#exampleModal"
            onClick={this.handleSetNewLogoFacility(logo.imgBase64)}
          >
            Edit
          </button>
        </div>
      ))
    );
  }

  render() {
    return (
      <div className="App-header">
        {this.renderLogoList()}
        <div
          className="modal fade"
          id="exampleModal"
          tabIndex="-1"
          role="dialog"
          aria-labelledby="exampleModalLabel"
          aria-hidden="true"
        >
          <div className="modal-dialog" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title" id="exampleModalLabel">
                  Modal title
                </h5>
                <button
                  type="button"
                  className="close"
                  data-dismiss="modal"
                  aria-label="Close"
                >
                  <span aria-hidden="true">&times;</span>
                </button>
              </div>
              <div className="modal-body">
                <img
                  src={this.state.newLogoFacility}
                  style={{ width: 200, height: 200 }}
                />
                <input type="file" onChange={this.handleChangeUpdateLogo} />
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  data-dismiss="modal"
                >
                  Close
                </button>
                <button type="button" className="btn btn-primary">
                  Save changes
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
